INSERT INTO elmis_help_topic (level, name, created_by, createddate, modifiedby, modifieddate, id, parent_help_topic_id, is_category, html_content) VALUES (0, 'Vaccine Report Legend', NULL, NULL, NULL, NULL, 4, NULL, true, NULL);
INSERT INTO elmis_help_topic (level, name, created_by, createddate, modifiedby, modifieddate, id, parent_help_topic_id, is_category, html_content) VALUES (0, 'consumption.graph.legend', NULL, NULL, NULL, NULL, 5, 4, false, '<div style="color: rgb(34, 34, 34);background-color: rgb(255, 255, 255);"><b>Definition:</b></div><div style="color: rgb(34, 34, 34);background-color: rgb(255, 255, 255);"><br/></div><div style="color: rgb(34, 34, 34);background-color: rgb(255, 255, 255);">Average monthly consumption (AMC) is an average of last three months of vaccines issued/used at facility level (the dispensing point). If a facility didn''t submitted monthly IVD report during the last three months, only submitted data points will be used for this average calculation. In other words, out of last three months, if only two months data are available, then the average calculation will use only two months. </div><div style="color: rgb(34, 34, 34);background-color: rgb(255, 255, 255);"><br/></div><div style="color: rgb(34, 34, 34);background-color: rgb(255, 255, 255);"><b>How to interpret:</b></div><div style="color: rgb(34, 34, 34);background-color: rgb(255, 255, 255);">A trend in the AMC indicates consumption pattern. A pattern can remain flat, rising, zigzag or falling.</div><div style="color: rgb(34, 34, 34);background-color: rgb(255, 255, 255);"><br/></div><div style="color: rgb(34, 34, 34);background-color: rgb(255, 255, 255);"><b>Tips for supportive supervision:</b></div><div style="color: rgb(34, 34, 34);background-color: rgb(255, 255, 255);">- Rising or falling pattern can be as a result of seasonal variation in consumption. It can also indicate program performance. Zigzag or unexpected patterns should be follow-up through supervisory actions.</div>');
INSERT INTO elmis_help_topic (level, name, created_by, createddate, modifiedby, modifieddate, id, parent_help_topic_id, is_category, html_content) VALUES (0, 'soh.graph.legend', NULL, NULL, NULL, NULL, 6, 4, false, '<div style="color: rgb(34, 34, 34);background-color: rgb(255, 255, 255);"><b>Definition:</b></div><div style="color: rgb(34, 34, 34);background-color: rgb(255, 255, 255);"><br/></div><div style="color: rgb(34, 34, 34);background-color: rgb(255, 255, 255);">Stock on hand (SOH) is ending balance at the end of the reporting period. </div><div style="color: rgb(34, 34, 34);background-color: rgb(255, 255, 255);"><br/></div><div style="color: rgb(34, 34, 34);background-color: rgb(255, 255, 255);"><b>How to interpret:</b></div><div style="color: rgb(34, 34, 34);background-color: rgb(255, 255, 255);">For each product, standard operating procedures (SOH) determines whether the facility is maintaining sufficient stock on hand. Some facilities may have to maintain higher or lower than normal SOH, for situation such as remote location, on the flooding zone, seasonal outbreak and so on. SOH divided by the AMC gives the months of stock [SOH / AMC = MOS]. MOS are tied with ordering/replenishment cycle. MIN and MAX levels determines the stocking policy. A buffer stock level helps when replacements are not received on time. </div><div style="color: rgb(34, 34, 34);background-color: rgb(255, 255, 255);"><br/></div><div style="color: rgb(34, 34, 34);background-color: rgb(255, 255, 255);"><b>Tips for supportive supervision:</b></div><div style="color: rgb(34, 34, 34);background-color: rgb(255, 255, 255);">- MOS level below MIN should be proactively followed up to avoid potential stock-out situation. </div><div style="color: rgb(34, 34, 34);background-color: rgb(255, 255, 255);">- MOS above MAX is an overstocked situation should be followed up to avoid stocking imbalances in the distribution system.</div><div style="color: rgb(34, 34, 34);background-color: rgb(255, 255, 255);">- Overstocked commodities can be transferred to adjacent facilities or returned.</div><div style="color: rgb(34, 34, 34);background-color: rgb(255, 255, 255);">- For overstocked commodities, expiration dates should be paid attention to, to avoid products running risk of expiry.</div>');


